const dotenv = require('dotenv');
dotenv.config();
const fs = require('fs');
const {
  GoogleGenAI,
} = require ('@google/genai');

async function run(image) {
  const ai = new GoogleGenAI({
    apiKey: process.env.GEMINI_API_KEY,
  });
  const config = {
    responseMimeType: 'text/plain',
    systemInstruction: [
        {
          text: `return true if the image has dirty or garbage
else return false in json format with confidence also
`,
        }
    ],
  };
  const model = 'gemma-3-1b-it';
  const contents = [
    {
      role: 'user',
      parts: [
        {
          inlineData: {
            data: ``,
            mimeType: `image/webp`,
          },
        },
      ],
    },
    {
      role: 'model',
      parts: [
        {
          text: `\`\`\`json
{
  "relevant": true,
  "confidence": 0.99
}
\`\`\``,
        },
      ],
    },
    {
      role: 'user',
      parts: [
        {
          inlineData: {
            data: ``,
            mimeType: `image/jpeg`,
          },
        },
      ],
    },
    {
      role: 'model',
      parts: [
        {
          text: `\`\`\`json
{
  "relevant": false,
  "confidence": 1.0
}
\`\`\``,
        },
      ],
    },
    {
      role: 'user',
      parts: [
        {
          text: `${image}`,
          mimeType: `image/webp`,
        },
      ],
    },
  ];

  const response = await ai.models.generateContentStream({
    model,
    config,
    contents,
  });
  let fileIndex = 0;
  let text = "";
  for await (const chunk of response) {
    console.log(chunk.text);
    text+= chunk.text;
  }
  return text
}

